import { Injectable } from "@angular/core";
import { BehaviorSubject, of } from "rxjs";
import { Observable } from 'rxjs/internal/Observable';


@Injectable()
export class ProductService{
    constructor(){}


    products:Product[] = [ ];

    public sendProducts(nombre:string, apellido1:string,apellido2:string,edad:number,email:string,telefono:number,fechaNacimiento:Date,ciudad:string, genero:string):Observable<Product[]>{
        if(nombre != "" && apellido1 != "" && apellido2 != "" && edad != null && email != "" && telefono != null && fechaNacimiento != null&& ciudad != null&& genero != null){
            this.products.push({nombre: nombre, apellido1: apellido1,  apellido2: apellido2, edad: edad,email: email,telefono: telefono,fechaNacimiento: fechaNacimiento,ciudad: ciudad,genero: genero,});
        }
        return of(this.products);
    }

}
export interface Product {nombre: string;  apellido1: string; apellido2: string; edad: number;email: string;fechaNacimiento: Date;telefono: number;ciudad: string;genero: string; }
